import React from 'react';
import Jumbotron from 'react-bootstrap/Jumbotron'
import Container from 'react-bootstrap/Container'
import './Content.css'

const Content = () => {
    return (
        <div>
            <Jumbotron className="Jumbo">
                <Container>
                    <h1 class="d-block mb-4" data-aos="fade-up" data-aos-delay="200">TERROR PREDICTION SYSTEM</h1>
                    <span class="d-block mb-3 caption" data-aos="fade-up" data-aos-delay="100">Making Military Solutions For All</span>



                </Container>
            </Jumbotron>
        </div>
    );

}

export default Content;
